import Header from "./Header";

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: "1px solid #DDD"
};

const Style = styled.a`
  color: red;
`;

export default function Layout(props) {
  return (
    <div>
      <Style>
        <Header />
        {props.children}
      </Style>
    </div>
  );
}
